const awsconfig = {
  Auth: {
    region: "YOUR_AWS_REGION",
    userPoolId: "YOUR_USER_POOL_ID",
    userPoolWebClientId: "YOUR_USER_POOL_WEB_CLIENT_ID",
  },
};

export default awsconfig;
